text:
President Trump has paused billions in funding to prevent and fight wildfires.

When the next megafire hits, our communities will be less prepared and in greater danger.

@RepHuffman, @RepJoeNeguse, and I are demanding the admin immediately reverse course w/ 54 of our colleagues. https://t.co/bKexkLvpWK

Our government should cut waste and be more efficient. However, that process must be transparent and allow citizens to weigh in.
 
@ElonMusk has spent the last week firing government officials who stand in his way of gaining access to your social security information and classified data. None of this is transparent, and the reckless way Elon has gone about this is putting American’s privacy at risk.
 
I strongly support @oversightdems attempt to subpoena Elon and let people understand what is being done with their private information.

The LA wildfires are a tragic reminder of the horrific nature of the megafire crisis.

@RepWesterman and I are again introducing our Fix Our Forests Act to help prevent catastrophic fires and give communities the tools to protect themselves.
https://t.co/LBqnGuJbOy
